    false,nt"url": null,nt"notes": "This narrative report for Wheeler National
    Wildlife Refuge outlines Refuge accomplishments from November 1941 to January 1942.
    The report begins by summarizing the personnel, weather, water conditions, and fires.
    Wildlife- including water birds, upland game birds, fur bearing animals, and big
    game animals- is also covered. The Refuge development discusses physical development,
    plantings. The public relations section of the report describes national defense,
    recreational relations and violations. Economic uses of the refuge including, cooperative
    farming is discussed.",nt"license_title": "License Not Specified",nt"extras":
